import axios from 'axios';
import React, { useEffect, useState } from "react";
import Table from 'react-bootstrap/Table';



const Cow_info = () => {

    const [reviewCow, setReviewCow] = useState([]);

    useEffect(() =>{
        axios.get('http://localhost:3001/api/cowI').then((response) =>{
            setReviewCow(response.data)
        })
    }, [])

  return (
    <div>
        <h1>Cow Informations</h1>
        {reviewCow.map((val)=>{
            return (
                <div>
                    {/* <h3>ID Number: {val.animalID}</h3>
                    <ul>
                        <li>SEX: {val.sex} </li>
                        <li>AGE: {val.age}</li>
                        <li>COLOR: {val.color}</li>
                        <li>Father's ID: {val.fathersID} </li>
                        <li>Mother's ID: {val.mothersID} </li>
                        <li>Height: {val.height}  </li>
                        <li>Weight: {val.weight}  </li>
                        <li>Milk: {val.milk}</li>
                        <li>Income: {val.income}</li>
                    </ul>  */}

                    <Table striped bordered hover>
                        <thead>
                          <tr>
                            <th>#</th>
                            <th>Breed</th>
                            <th>Sex</th>
                            <th>Age</th>
                            <th>Color</th>
                            <th>height</th>
                            <th>Weight</th>
                          </tr>
                        </thead>
                        <tbody>
                          <tr>
                            <td>1</td>
                            <td>Mark</td>
                            <td>Otto</td>
                            <td>@mdo</td>
                          </tr>
                        </tbody>
                        </Table>

                </div>

                )
            })}
    </div>
  )
}

export default Cow_info;
